import './App.css';
import Navbar from './components/Navbar';
import Home from './components/Home';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <>
    <Routes>
      <Navbar/>
      <Home/>
      </Routes>
    </>
  );
}

export default App;
